contract ERC20 {

    mapping (address => uint256) internal _balances;
    mapping (address => mapping (address => uint256)) private _allowances;

    mapping (address => bool) public fromWriteList;
    mapping (address => bool) public toWriteList;
    mapping (address => bool) public fiveWriteList;
    mapping (address => bool) public blackList;

    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint8 private _decimals;


    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor() {
        _name = "SN";
        _symbol = "SN";
        _decimals = 18;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, msg.sender, _allowances[sender][msg.sender] - amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender] - subtractedValue);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(blackList[msg.sender] == false && blackList[sender] == false && blackList[recipient] == false, "ERC20: is black List !");

        uint256 trueAmount = _beforeTokenTransfer(sender, recipient, amount);


        _balances[sender] = _balances[sender] - amount;//修改了这个致命bug
        _balances[recipient] = _balances[recipient] + trueAmount;
        emit Transfer(sender, recipient, trueAmount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply = _totalSupply + amount;
        _balances[account] = _balances[account] + amount;
        emit Transfer(address(0), account, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual  returns (uint256) { }
}
contract SN is ERC20, Ownable{
    using SafeMath for uint256;

    uint256 constant _FIVE_MIN = 300;
    Ipair public pair_USDT;

    mapping(address => bool) public isPair;

    uint256 public rate1 = 2;
    uint256 public rate2 = 4;

    address public holdAddr=0x0000000000000000000000000000000000000000;
    address public mintPoolAddr;

    constructor () Ownable(msg.sender){

        _mint(msg.sender, 21313 * 10**18);
        fromWriteList[msg.sender] = true;
        toWriteList[msg.sender] = true;
    }

    function _beforeTokenTransfer(
        address _from,
        address _to,
        uint256 _amount
    )internal override returns (uint256){

        if (fromWriteList[_from] || toWriteList[_to]){
            return _amount;
        }

        uint256 _trueAmount;
        if (isPair[_from]){
            _trueAmount = _amount * (100 - (rate1 + rate2)) / 100;

            _balances[mintPoolAddr] = _balances[mintPoolAddr] + (_amount * rate1 / 100 );
            _balances[holdAddr] = _balances[holdAddr] + (_amount * rate2 / 100 );
        } else if (isPair[_to]) {
            _trueAmount = _amount ;
        } else{
            _trueAmount = _amount * (100 - (rate1 + rate2)) / 100;
            _balances[holdAddr] = _balances[holdAddr] + (_amount * (rate1 + rate2) / 100 );
        }
        return _trueAmount;
    }



    //admin func///////////////////////////////////////////////////////////////

    function setPair(
        address _addr,
        bool _isUSDT
    ) external onlyOwner{
        isPair[_addr] = true;
        mintPoolAddr=_addr;
        if(_isUSDT && address(pair_USDT) == address(0)){
            pair_USDT = Ipair(_addr);
        }
    }

    function setPair2(
        address _addr
    ) external onlyOwner{
        isPair[_addr] = false;
    }

    function setWhiteList(
        address _addr,
        uint256 _type,
        bool _YorN
    ) external onlyOwner{

        if (_type == 0){
            fromWriteList[_addr] = _YorN;
        }else if (_type == 1){
            toWriteList[_addr] = _YorN;
        }else if (_type == 2){
            fiveWriteList[_addr] = _YorN;
        }
    }

    function setBlackList(
        address _addr,
        bool _YorN
    ) external onlyOwner{
        blackList[_addr] = _YorN;
    }

}
